var title_f15_56_16269="Chron HBV dosage adjustment";
var content_f15_56_16269=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=GAST%2F71024&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=GAST%2F71024&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Adjustment of adult dosage of nucleos(t)ide analogue in accordance with creatinine clearance",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tr>",
"      <td class=\"subtitle1\">",
"       Creatinine clearance, mL/min *",
"      </td>",
"      <td class=\"subtitle1\" colspan=\"2\">",
"       Recommended dose",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"subtitle2_left\" colspan=\"2\">",
"       a. Lamivudine",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"indent1\">",
"       &ge;50",
"      </td>",
"      <td colspan=\"2\">",
"       100 mg daily",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"indent1\">",
"       30-49",
"      </td>",
"      <td colspan=\"2\">",
"       100 mg first dose, then 50 mg daily",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"indent1\">",
"       15-29",
"      </td>",
"      <td colspan=\"2\">",
"       35 mg first dose, then 25 mg daily",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"indent1\">",
"       5-14",
"      </td>",
"      <td colspan=\"2\">",
"       35 mg first dose, then 15 mg daily",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"indent1\">",
"       &lt;5",
"      </td>",
"      <td colspan=\"2\">",
"       35 mg first dose, then 10 mg daily",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"subtitle2_left\" colspan=\"2\">",
"       b. Adefovir",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"indent1\">",
"       &ge;50",
"      </td>",
"      <td colspan=\"2\">",
"       10 mg daily",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"indent1\">",
"       20-49",
"      </td>",
"      <td colspan=\"2\">",
"       10 mg every other day",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"indent1\">",
"       10-19",
"      </td>",
"      <td colspan=\"2\">",
"       10 mg every third day",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"indent1\">",
"       Hemodialysis patients",
"      </td>",
"      <td colspan=\"2\">",
"       10 mg every week following dialysis",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"subtitle2_left\" colspan=\"2\">",
"       c. Entecavir",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"subtitle3_left\" colspan=\"2\">",
"       NA na&iuml;ve",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"indent2\">",
"       &ge;50",
"      </td>",
"      <td>",
"       0.5 mg daily",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"indent2\">",
"       30-49",
"      </td>",
"      <td>",
"       0.25 mg daily or 0.5 mg every 48 hr",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"indent2\">",
"       10-29",
"      </td>",
"      <td>",
"       0.15 mg daily or 0.5 mg every 72 hr",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"indent2\">",
"       &lt;10 or hemodialysis&bull; or continuous ambulatory peritoneal dialysis",
"      </td>",
"      <td>",
"       0.05 mg daily or 0.5 mg every 7 days",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"subtitle3_left\" colspan=\"2\">",
"       Lamivudine refractory/resistant",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"indent2\">",
"       &ge;50",
"      </td>",
"      <td>",
"       1 mg daily",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"indent2\">",
"       30-49",
"      </td>",
"      <td>",
"       0.5 mg daily or 1 mg every 48 hr",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"indent2\">",
"       10-29",
"      </td>",
"      <td>",
"       0.3 mg daily or 1 mg every 72 hr",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"indent2\">",
"       &lt;10 or hemodialysis&bull; or continuous ambulatory peritoneal dialysis",
"      </td>",
"      <td>",
"       0.1 mg daily or 1 mg every 7 days",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"subtitle2_left\" colspan=\"2\">",
"       d. Telbivudine",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"indent1\">",
"       &ge;50",
"      </td>",
"      <td colspan=\"2\">",
"       600 mg once daily",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"indent1\">",
"       30-49",
"      </td>",
"      <td colspan=\"2\">",
"       600 mg once every 48 hours",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"indent1\">",
"       &lt;30 (not requiring dialysis)",
"      </td>",
"      <td colspan=\"2\">",
"       600 mg once every 72 hours",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"indent1\">",
"       End-stage renal disease",
"      </td>",
"      <td colspan=\"2\">",
"       600 mg once every 96 hours&bull;",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"subtitle2_left\" colspan=\"2\">",
"       e. Tenofovir",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"indent1\">",
"       &ge;50",
"      </td>",
"      <td colspan=\"2\">",
"       300 mg every 24 hrs",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"indent1\">",
"       30-49",
"      </td>",
"      <td colspan=\"2\">",
"       300 mg every 48 hrs",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"indent1\">",
"       10-29",
"      </td>",
"      <td colspan=\"2\">",
"       300 mg every 72-96 hrs",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"indent1\">",
"       &lt;10 with dialysis",
"      </td>",
"      <td colspan=\"2\">",
"       300 mg once a week or after a total of approximately 12 hours of dialysis",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"indent1\">",
"       &lt;10 without dialysis",
"      </td>",
"      <td colspan=\"2\">",
"       No recommendation",
"      </td>",
"     </tr>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"     * See UpToDate calculator \"Calculator: Creatinine clearance estimate by Cockcroft-Gault equation\".",
"     <br>",
"      &bull; Administer after hemodialysis.",
"     </br>",
"    </div>",
"    <div class=\"reference\">",
"     Reproduced with permission from: Lok ASF, McMahon BJ. Chronic hepatitis B: Update 2009. Hepatology 2009; 50:661. Available online at file://publish.aasld.org/Pages/Default.aspx. Accessed September 8th 2009. Copyright &copy; 2009 American Association for the Study of Liver Diseases.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
